After the split S → NT5 NT4, NT5 must cover the first terminal “t20” (NT5→‘t20’) and NT4 must generate the remaining ten terminals

    t13 t18 t14 t3 t22 t4 t3 t11 t0 t4.

In Chomsky normal form, NT4 can either be a single terminal (‘t13’ or ‘t4’), a binary NT4→NT15 NT42, or use the left‐recursive rule NT4→NT4 NT69.  To get ten terminals from NT4, one would begin with the base NT4→‘t13’ (to match the first of those ten), and then NT69 must generate each of the remaining nine tokens in order.  But NT69, whether as a single terminal or via its two binary productions, can only yield certain very restricted terminal patterns:

  • As a terminal: NT69→{t17,t15,t3}  
  • Via NT69→NT71 NT3: two terminals from NT71∈{t0,t18,t22,t16,t12,t10} followed by NT3∈{t18,t15}  
  • Via NT69→NT65 NT45: at least three terminals, and the very first must be NT65∈{t14,t19}  

No matter how you slice the remainder

    t18 t14 t3 t22 t4 t3 t11 t0 t4

into 1–, 2–, or 3–terminal chunks, you cannot match all tokens in sequence with NT69’s limited terminals.  Hence NT4 cannot derive that ten‐long tail, and so S cannot derive the whole string.  

